import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Card, CardContent, Chip, Container, Grid, Typography } from '@mui/material';

function PatientsBooking() {
  const [doctorsAvailability, setDoctorsAvailability] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/v3/getAvailability')
      .then(response => {
        setDoctorsAvailability(response.data);
      })
      .catch(error => {
        console.error('Error fetching doctors availability:', error);
      });
  }, []);

  return (
    <Container maxWidth="md">
      <Grid container spacing={3}>
        {doctorsAvailability.map(doctor => (
          <Grid key={doctor.doctorName} item xs={12} sm={6} md={4}>
            <Card style={{ height: '100%' }}>
              <CardContent>
                <Typography variant="h6">Doctor: {doctor.doctorName}</Typography>
                <Typography variant="body1">Specialist: {doctor.specialist}</Typography>
                <Typography variant="body2">Available Dates:</Typography>
                {doctor.availability.map((availabilityItem, index) => (
                  <div key={index}>
                    <Typography variant="body2">{availabilityItem.dates[0]}</Typography>
                    {availabilityItem.startTimes.map((startTime, timeIndex) => (
                      <Chip key={timeIndex} label={startTime} style={{bor}} variant="outlined" color="primary" className="mt-2" />
                    ))}
                  </div>
                ))}
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default PatientsBooking;
